import React from 'react';
import {
  Drawer,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  CssBaseline,
  Container,
  Typography,
} from '@mui/material';
import { Inbox as InboxIcon, Mail as MailIcon } from '@mui/icons-material';

function App() {
  return (
    <div>
      {/* First Sidebar with Icon */}
      <Drawer anchor="left" open={true} sx={{ background: 'green', width: '100px', height: '1024px' }}>
        {/* Place your icon here */}
        <div style={{ textAlign: 'center', marginTop: '20px' }}>
          <InboxIcon style={{ color: 'white' }} />
        </div>
      </Drawer>

      {/* Second Sidebar with Navigation Items */}
      <Drawer anchor="left" open={true} sx={{ background: '#0D0D0F', width: '218px', height: '1024px', left: '100px' }}>
        <List>
          <ListItem button>
            <ListItemText primary="Live" />
          </ListItem>
          <ListItem button>
            <ListItemText primary="Sequence" />
          </ListItem>
          <ListItem button>
            <ListItemText primary="Layout" />
          </ListItem>
          <ListItem button>
            <ListItemText primary="More" />
          </ListItem>
        </List>
      </Drawer>

      {/* Main Content Container */}
      <div style={{ marginLeft: '318px' }}>
        <Container
          maxWidth="xl"
          style={{ backgroundColor: '#111115', minHeight: '100vh' }}
        >
          {/* Your content goes here */}
        </Container>
      </div>
    </div>
  );
}

export default App;
